import React, { useEffect } from 'react'

const Covid =()=>{
    const getdata = async () =>{
        try{
            const res= await fetch('https://api.rootnet.in/covid19-in/stats/latest');
            const data = res.json();

        }catch(err){
            console.log(err);
        }
    }

    useEffect(() =>{
        getdata();

    },[]);
    return(
        <>
        <h1>covid app</h1>

        </>
    )
}
export default Covid
